<script setup lang="ts">
import { onMounted, onUnmounted, ref, watch } from 'vue';
import { RouterLink } from 'vue-router';
import { AnimatePresence, motion } from 'motion-v'

const emit = defineEmits(['scrollto']);
const isNavbarOpen = ref(false);
const navRef = ref<HTMLElement | null>(null);
const isScrolled = ref(false);

// Update when user scrolls
const handleScroll = () => {
    isScrolled.value = window.scrollY > 0;
};

onMounted(() => {
    window.addEventListener('scroll', handleScroll);
    handleScroll(); // Run once to initialize
});

onUnmounted(() => {
    window.removeEventListener('scroll', handleScroll);
});

const parentVisible = ref(false);
watch(() => isNavbarOpen.value, (newVal) => {
    if (newVal) {
        parentVisible.value = newVal;
    } else {
        setTimeout(() => {
            parentVisible.value = newVal;
        }, 200);
    }
})

</script>

<template>
    <header ref="navRef" :class="[
        'w-full bg-[#FFFFFF] z-50 lg:grid items-center text-black transition-all duration-300 shadow-md',
