                <RouterLink :to="{ name: 'Home' }" class="hover:text-xl transition-all duration-300">
                    home
                </RouterLink>
                <RouterLink :to="{ name: 'About' }" class="hover:text-xl transition-all duration-300">
                    about
                </RouterLink>
                <RouterLink :to="{ name: 'Team' }" class="hover:text-xl transition-all duration-300">
                    team
                </RouterLink>
                <RouterLink :to="{ name: 'Press' }" class="hover:text-xl transition-all duration-300">
                    press
                </RouterLink>
                <button @click="emit('scrollto')" class="cursor-pointer hover:text-xl transition-all duration-300">
                    contact
                </button>
            </div>

            <!-- Mobile Nav -->
            <div class="lg:hidden relative min-h-10 flex items-center">
                <AnimatePresence :initial="false">
                    <motion.button class="menu" :class="{ opened: isNavbarOpen }" :aria-expanded="isNavbarOpen"
                        :initial="{ opacity: 0, scale: 0 }" :animate="{ opacity: 1, scale: 1 }"
                        :exit="{ opacity: 0, scale: 0 }" v-if="!isNavbarOpen" @click="isNavbarOpen = !isNavbarOpen"
                        aria-label="Main Menu">
                        <svg width="25" height="25" viewBox="0 0 100 100">
                            <path class="line line1"
                                d="M 20,29.000046 H 80.000231 C 80.000231,29.000046 94.498839,28.817352 94.532987,66.711331 94.543142,77.980673 90.966081,81.670246 85.259173,81.668997 79.552261,81.667751 75.000211,74.999942 75.000211,74.999942 L 25.000021,25.000058" />
                            <path class="line line2" d="M 20,50 H 80" />
